  [],\n\t\"revision_timestamp\": \"2016-07-27T22:20:49.203620\",\n\t\"name\": \"moose-habitat-management-plan-kenai-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Kenai NWR Moose/Habitat Management
  Plan was developed to guide future FWS management of moose/habitat on Kenai NWR.
  The present status and trend of Kenai NWR moose populations are evaluated, and factors
  affecting moose population dynamics are examined. Based on these analyses, FWS proposes
  to work with the Alaska Department of Fish and Game in the following actions to
  maintain viable and healthy moose populations at near-current densities on the Refuge:
  1) implementation of a long-term habitat manipulation program using prescribed burning
  as a primary tool; 2) continued monitoring of the status of moose populations using
  aerial surveys, direct animal assessments, and habitat evaluation; 3) continuation
  of selective harvest regulations for bull moose and establishment of moose population
  composition objectives for moose populations in the northern, central, and southern
  portions of the Refuge; 4) examination of predator-prey relationships and highway
  accidents involving moose in order to determine their future implications to moose
  and predator population dynamics and moose management; and 5) identification of
  research priorities related to moose management on the Refuge.\",\n\t\"license_title\":
